children.text:
 /* Make test easier to read */
.test, .control {
  color: blue;
  font: bold larger monospace;
  margin: 1em;
  padding: 0.25em;
  border: solid silver;
  float: left;
}
.set {
  clear: both;
  float: left;
  border-bottom: solid orange;
}
p + .set {
  border-top: solid orange;
}

/* ensure BDO processing */
bdo {
  unicode-bidi: bidi-override;
  direction: ltr;
}
